weboperation checkOnline 
javascript

var EMPID ; 
// Update the online status icon based on connectivity
window.addEventListener('online',  updateIndicator);
window.addEventListener('offline', updateIndicator);
updateIndicator();

moment().format('MMMM Do YYYY, h:mm:ss a');


$(window).bind('beforeunload',function(){
     if (!navigator.onLine) return (-1); 
});

$(window).on('load', function(){
    if (!navigator.onLine) {
       updateIndicator(); 
    }
});

function updateIndicator() {
    // Show a different icon based on offline/online
    if(navigator.onLine) {  
       $('#onlineoffline.fa-plane').removeClass('fa-plane').addClass('fa-wifi');
       downloadData();   
    } else {
       var vInstance = uniface.getInstance("DSPPILOTTRIP")
       var vEntity = null;
       vEntity = vInstance.getEntity("PILOT.AIRLINE");
       var T_EMPID = vEntity.getOccurrence(0).getField("HIDDENEMPID.PILOT.AIRLINE").getValue();
       $('body').empty();
       loadLostNetwork(); 
       reloadData(T_EMPID);  
       $('#onlineoffline.fa-wifi').removeClass('fa-wifi').addClass('fa-plane');   
    }
} 

function loadLostNetwork() {
     BootstrapDialog.show({  message: 'Network Connection was lost. Close to reload from local storage.'        });
}

function reloadData(empid) {
    var db = new PouchDB('pilotschedule', {auto_compaction: true}); 
 
    db.get(empid).then( function (result) {
           $('body').html( result.html.replace('fa-wifi','fa-plane') );
          console.log('Successfully returned a pilot schedule!');
           $('#updated').html("Last Updated: " + result.lastUpdated);
           $('#onlineoffline.fa-wifi').removeClass('fa-wifi').addClass('fa-plane');                             
    }).catch(function (err) {
       console.log( "Error returning HTML ");
       console.log( err );
    });

}



function downloadData() { 

    var db = new PouchDB('pilotschedule',{auto_compaction: true}); 
    var id;
    var rev;
    var vInstance = uniface.getInstance("DSPPILOTTRIP")
    var vEntity = null;
    
    if (vInstance != null) {
       vEntity = vInstance.getEntity("PILOT.AIRLINE");
       EMPID = vEntity.getOccurrence(0).getField("EMPID.PILOT.AIRLINE").getValue();
    } else {
       EMPID = $('#HIDDENEMPID.PILOT.AIRLINE').val(); 
    }   

    var remoteCouch = false;  
    var bodyHTML = $('body').html();

    var docBody = { _id: '',
                   html: '',
                   lastUpdated: ''
                   };
    
    db.get(EMPID).then(function (doc) { 
       var dateNow = new Date();
       doc.lastUpdated = moment(dateNow).toString();
       doc.html = bodyHTML; 
      return db.put(doc);
    }).then(function () { 
      return db.get(EMPID);
    }).catch( function (err) {
       if (err.name == 'not_found') {
           docBody.html = bodyHTML;
           docBody._id = EMPID;
           var dateNow = new Date();
           docBody.lastUpdated = moment(dateNow).toString() ;
           db.put(docBody);
       } else {
           console.log(err);
       }
    });

    $('#updated').html("");


}

endjavascript
end

