public web
	
	variables
		string urlpresented
		string xtype
		string qualifier 
		string item
		string subitem
		string debugstring
		string vOutput
		string requestmethod, server_variables, sentparameters
		string accept, content_type, output_type, uppercasecontent
		string url,vSessionAttributes
		numeric vStatus
		string contactRep, loadHTMLData, resolvedHTML
		string varList, vItemId, vItemValue
		string WebServerCntxt, iSessionId 
		struct sessionStruct
		struct rootStruct, speakerStruct, materialStruct, materialStructRoot, photoStruct, contactStruct, locationStruct
	endvariables
	
	urlpresented = $webinfo("PATHINPUT")
	
	;
	; No complete path specified so return a 204
	;
	
	getitem/id server_variables, $webinfo("WEBSERVERCONTEXT"), "SERVERVARIABLES"
	getitem/id requestmethod, server_variables, "REQUEST_METHOD"
	
	vStatus = $split($item("SERVER_PROTOCOL", server_variables), 1, "/", url, "")
	url = $concat($concat($lowercase(url), "://", $item("SERVER_NAME", server_variables), ":", $item("SERVER_PORT", server_variables)), $item("REQUEST_URI", server_variables))
	
	getitem/id accept, $webinfo("HTTPREQUESTHEADERS"), "accept"
	getitem/id content_type, $webinfo("HTTPREQUESTHEADERS"), "content-type"
	
	
	if (requestmethod = "OPTIONS")
		$webinfo("status") = "200"
		putitem/id $webinfo("httpresponseheaders"),"Allow","GET,HEAD,OPTIONS"  
		$webinfo("output") = "Allow: GET, HEAD, OPTIONS";
		return (0)
	endif
	
	if ($length(urlpresented) = 0) 
		$webinfo("status")="204"
		$webinfo("output") = "204 No Data Present"
		return (0)
	endif
	
	
	putitem/id $webinfo("httpresponseheaders"),"Content-Type", "text/json" ; removed charset=
	
	;
	; Method other than GET/HEAD specified
	;
	if (requestmethod != "GET" && requestmethod != "HEAD")
		$webinfo("status") = "405"
		return (0)
	endif
	
	getitem sentparameters, urlpresented, 1 
	
	if (sentparameters != "")
		sessionid.sessions/init = sentparameters
		retrieve
		if ($status = 0)
			
			if ($valrep(CONTACTTYPE) = "")
				activate "WIDGET_LOADER".load_contacttype()
				$valrep(CONTACTTYPE) = $result
			endif
			
			if ($valrep(roomid.EVENT_SESSION) = "")
				activate "WIDGET_LOADER".load_ROOMS( LOCATIONID.EVENT)
				$valrep(ROOMID.EVENT_SESSION) = $result
			endif                        
			
			setocc "SESSIONS",-1
			setocc "SESSIONS",1
			
			$session_title$ = session_name.SESSIONS
			$speaker_id$ = SPEAKERID.SPEAKER
			$session_time$ = START_TIME.EVENT_SESSION
			$session_location$ = roomname
			$speaker_name$ = fullname.speaker
			$event_id$ = EVENTID.EVENT
			if (contactfield.contacts != "")
				getitem/id contactRep, $valrep(CONTACTTYPE.CONTACTS), CONTACTTYPE.CONTACTS
				$speaker_contact$ = "%%$valuepart(contactRep) - %%CONTACTFIELD.CONTACTS"
			else
				$speaker_contact$ = ""
			endif
			$session_description$ = sessiondescription
			
; Initialize Varlist with all component variables.
;	Varlist = $componentinfo($instancename, "VARIABLES")
;	putlistitems/id /component Varlist 
;	forlist/id vItemId, vItemValue in varList 
;		putitem/id $webinfo("USERCONTEXT"), vItemId, vItemValue
;		putmess "%%$instancename SetState - USERCONTEXT(%%vItemId) = '%%vItemValue'"
;	endfor
;	;$webinfo("USERCONTEXT") = VarList
;	WebServerCntxt = $webinfo("WEBSERVERCONTEXT")
;	getitem/id iSessionId, WebServerCntxt, "SESSION"
;	activate "USYSSTAT".SetState(iSessionId, "GLOBAL", $webinfo("USERCONTEXT"))
;	 
;	putitem/id $webinfo ("SESSIONCOMMANDS"), "SetAttributes" , $webinfo("USERCONTEXT")
;
;;;; was commented out not sure why
		fileload/text  "DSPMODAL.HTS", loadHTMLData

		if ($status > 0)
			resolvedHTML = $expression("%%"%%loadHTMLData%%"")                         
			HTMLDATA.SESSIONS = resolvedHTML
		else
			HTMLDATA.SESSIONS = "<ul><li>%%$session_title$</li><li>Description : %%$session_description$</li><li>Speaker : %%$speaker_name$<img id='speakerimage' alt='Speaker Photo' src='%%NEWPHOTO.PHOTOS'></li></ul>";
		endif
		
		
		SPEAKERPHOTO = SPEAKERPHOTO[2]
		componenttostruct sessionStruct, "SESSIONS.EVENTS"
		sessionStruct->OCC->$name = "root"
		rootStruct = sessionStruct->root;
		
		rootStruct->SESSIONID->$name = "id"
		rootStruct->DURATION->$name = "duration"
		rootStruct->ALL_DAY_EVENT->$name = "allday"
		rootStruct->SESSION_NAME->$name = "name"
		rootStruct->SESSIONDESCRIPTION->$name = "description"
		rootStruct->SPEAKER->$name = "speakerid";
		
		locationStruct = rootStruct->EVENT_SESSION.EVENTS
		
		locationStruct->$name = "location";
		locationStruct->ROOMID->$name = "room";
		locationStruct->ROOMNAME->$name = "name";
		
		speakerStruct = rootStruct->SPEAKER.EVENTS;
		
		speakerStruct->$name = "speaker";
		speakerStruct->OCC->$name = "root";
		
		speakerStruct = rootstruct->speaker->root;
		
		speakerStruct->FULLNAME->$name = "fullname" 
		speakerStruct->SPEAKERID->$name="id" 
		speakerStruct->TITLE->$name="title" 
		speakerStruct->FIRSTNAME->$name="firstname" 
		speakerStruct->PREFERREDFIRST->$name="preferredfirst" 
		speakerStruct->MIDDLENAME->$name="middlename" 
		speakerStruct->LASTNAME->$name="lastname" 
		speakerStruct->SUFFIX->$name="suffix" 
		
		;
		; Contact Info if Available        
		;
		contactStruct = speakerStruct->CONTACTS.EVENTS;
		contactStruct->$name = "contactinfo";
		contactStruct->OCC->$name = "root";
		contactStruct->root->CONTACTTYPE->$name = "type";
		contactStruct->root->CONTACTFIELD->$name = "data";
		;            
		; Photos
		;
		photoStruct = speakerStruct->PHOTOS.EVENTS;
		photoStruct->$name = "photos";
		photoStruct->OCC->$name = "root";
		photoStruct->root->SPEAKERPHOTO->$name = "photo"; 
		photoStruct->root->NEWPHOTO->$name = "webfilename";
		;
		; Materials
		;            
		materialStruct = rootStruct->SESSIONMATERIALS.EVENTS;
		materialStruct->$name = "materials"; 
		materialStruct->OCC->$name = "root";
		materialStructroot = materialStruct->root;
		
		materialStructroot->MATERIALBLOB->$name = "content";
		materialStructroot->MATERIALTYPE->$name = "type";
		materialStructroot->"SESSIONID"->$name = "session"            
		materialStructroot->"MATERIALID"->$name = "material"
		
		
		structToJSON /bmp /whitespace vOutput, sessionStruct 
		putitem/id $webinfo("httpresponseheaders"),"Content-Type", "text/json" ; removed charset=
		
		$webinfo("OUTPUT") = vOutput

	endif       
endif

return (1)

