function populateModal(eventURL) {
    var infoModal = $('#myModal');
    $.ajax({
        type: "GET",
        url: eventURL,
        dataType: 'json',
        success: function(data) {
        	// htmlData = '<ul><li>' + data.root.name + '</li><li>Description : ' + data.root.description + '</li><li>Speaker : ' + data.root.speaker.root.fullname + "<img id='speakerimage' alt='Speaker Photo' src='" + data.root.speaker.root.photos.root.webfilename + "'" + '></li></ul>';
			htmlData = data.root.HTMLDATA; 
          	infoModal.find('.modal-body').html(htmlData);
          	infoModal.modal('show');
        }
    });

    return false;
}


function load_calendar() {
    $('#calendar').fullCalendar({
        header: {
            left: '',
            center: 'title',
            right: ''
        },
       // defaultDate: '%%$formatDate$',
        editable: true,
        eventLimit: true, // allow "more" link when too many events
   		// events: 'DSPSCHEDULEDATA/%%$eventid$',
        eventClick: function(event) {
            if (event.url) {
                populateModal(event.url);
                return false;
            }
        }
    }); 
}
